-- this regexp describes file names we're interested in
local pat_x86 = [[^\w+ [\-_] (\d+(?:\.\d+)+[bcd]?) (?: -bin | -x86)? \.(?: 7z|zip) $]]
local pat_x64 = pat_x86:gsub("x86","x64")
local Rx_ver_x86 = regex.new(pat_x86, "ix" )
local Rx_ver_x64 = regex.new(pat_x64, "ix" )

local max_far1_date, max_far23_date = "", ""
for _,v in pairs(Far1_Dates)  do if max_far1_date  < v then max_far1_date  = v; end; end
for _,v in pairs(Far23_Dates) do if max_far23_date < v then max_far23_date = v; end; end

local function GetPluginsForFarBuild (aBaseDir, aFarVer, aFarBuild, aIsX64)
  local t, fardate = {}, nil
  if aFarVer==1                   then fardate = Far1_Dates[aFarBuild]  or max_far1_date
  elseif aFarVer==2 or aFarVer==3 then fardate = Far23_Dates[aFarBuild] or max_far23_date
  else error("invalid Far version")
  end
  if fardate then
    local Rx_ver = aIsX64 and Rx_ver_x64 or Rx_ver_x86
    for guid,path in pairs(GetPlugPaths(aFarVer)) do
      local bestdate, bestpath = "", nil
      far.RecursiveSearch(aBaseDir.."\\"..path, "*.7z;*.zip",
        function(item,fullpath)
          local ver = Rx_ver:match(item.FileName)
          if ver then
            local date = PlugDates[guid][ver:lower()]
            if date and date <= fardate and date > bestdate then
              bestdate,bestpath = date,fullpath
            end
          end
        end)
      if bestpath then t[guid] = bestpath; end
    end
  end
  return t
end

return {
  GetPluginsForFarBuild = GetPluginsForFarBuild;
}
